import React from 'react'

class Floor extends React.Component {

    constructor(props) {
        super(props)
        this.state = {
            floor: this.props.floor
        }
        this.deal = this.deal.bind(this)
    }

    deal() {
        this.setState({floor: this.props.floor})
    }

    render() {
        return (
            <form id='floor'>
                <ul>
                    {this.props.allFloors.map(x => (
                    <li key={x}>
                        <input 
                                type='radio' 
                                name='floor' 
                                value={x}
                                id={x} 
                                checked={x === this.state.floor}
                                onChange={this.deal}
                        />
                        <label htmlFor={x}>{x}</label>
                    </li>))}
                </ul>
            </form>)
    }
}

export default Floor
